function switchRoute(route) {
    [...document.getElementsByClassName("route")].map(e => {
        document.getElementById(e.id).style.display = "none";
    })
    localStorage.setItem("loadedPage", route);
    document.getElementById(route).style.display = "block";
}

function renderProduct(item) {
    var wrapper = document.createElement("div");
    var img = document.createElement("img");
    var title = document.createElement("p");
    var price = document.createElement("p");
    var button = document.createElement("button");
    title.textContent = item.name;
    price.textContent = item.price;
    button.textContent = "+";
    button.onclick = addToCart;
    button.id = JSON.stringify(item) 
    img.src = item.image;
    wrapper.classList.add("product-wrapper")
    wrapper.appendChild(img);
    wrapper.appendChild(title);
    wrapper.appendChild(price);
    wrapper.appendChild(button);
    document.getElementById("product-grid").appendChild(wrapper)
}

function addToCart(e) {
    if (localStorage.getItem("cart") && JSON.parse(localStorage.getItem("cart")).length > 0) {
        var cart = JSON.parse(localStorage.getItem("cart"));
        cart.push(JSON.parse(e.target.id));
        localStorage.setItem("cart", JSON.stringify(cart));
    } else {
        var cart = [];
        cart.push(JSON.parse(e.target.id));
        localStorage.setItem("cart", JSON.stringify(cart));
    }
    document.getElementById("badge").style.display = "inline";
    document.getElementById("badge").innerText++;
    loadCheckout();
}

function openCheckoutModal() {
    var element = document.getElementById("checkout-modal");
    element.style.opacity = "1";
    element.style.pointerEvents = "initial";
    element.focus();
    document.getElementById("checkout-opener").onclick = closeModal;
}

function closeModal() {
    document.getElementById("checkout-modal").style.opacity = "0";
    document.getElementById("checkout-modal").style.pointerEvents = "none";
    document.getElementById("checkout-opener").onclick = openCheckoutModal;
}

function loadCheckout() {
    var total = 0;
    if (localStorage.getItem("cart")) {
        document.getElementById("product-list").innerHTML = '';
        JSON.parse(localStorage.getItem("cart")).map(e => {
            var wrapper = document.createElement("div");
            var img = document.createElement("img");
            var title = document.createElement("div");
            var price = document.createElement("div");
            title.textContent = e.name;
            price.textContent = e.price;
            img.src = e.image;
            wrapper.appendChild(img);
            wrapper.appendChild(title);
            wrapper.appendChild(price);
            wrapper.classList.add("checkout-item")
            document.getElementById("product-list").appendChild(wrapper);
            total = total + parseFloat(e.price.replace('R$', ''))
        });
    }
    document.getElementById("total").textContent = "Total R$ " + total.toFixed(2);;
}